package com.javalec.ex.dto;

public class GraduatedDTO {

	private int seq;
	private String gratuatedCode;
	private String graduatedAcademy;
	
	public GraduatedDTO() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getSeq() {
		return seq;
	}

	public void setSeq(int seq) {
		this.seq = seq;
	}

	public String getGratuatedCode() {
		return gratuatedCode;
	}

	public void setGratuatedCode(String gratuatedCode) {
		this.gratuatedCode = gratuatedCode;
	}

	public String getGraduatedAcademy() {
		return graduatedAcademy;
	}

	public void setGraduatedAcademy(String graduatedAcademy) {
		this.graduatedAcademy = graduatedAcademy;
	}
	
}
